import React, { useState } from "react";
import { useNavigate } from "react-router-dom"; // Importa useNavigate
import { Container, LoginForm, Input, Button } from "./styles";

const LoginPage: React.FC = () => {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const navigate = useNavigate(); // Usa use

  const handleLogin = () => {
    if (username === "admin" && password === "Pass@2024") {
      // Login successful, you can redirect or perform any other action here
      console.log("Login successful");

      // Redireciona com base na versão do React Router
      if (history) {
        history.push("/dashboard"); // Redireciona para a página do painel
      } else if (navigate) {
        navigate("/dashboard");
      }
    } else {
      console.log("Login failed");
    }
  };

  return (
    <Container>
      <LoginForm>
        <h2>Login</h2>
        <Input
          type="text"
          placeholder="Username"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
        />
        <Input
          type="password"
          placeholder="Password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />
        <Button onClick={handleLogin}>Login</Button>
      </LoginForm>
    </Container>
  );
};

export default LoginPage;
